ESX = nil

Citizen.CreateThread(function()
	while ESX == nil do
		TriggerEvent('esx:getSharedObject', function(obj) ESX = obj end)
		Citizen.Wait(0)
	end

	while ESX.GetPlayerData().job == nil do
		Citizen.Wait(10)
	end

	PlayerData = ESX.GetPlayerData()
end)

local idmia = GetPlayerServerId(NetworkGetEntityOwner(GetPlayerPed(-1)))

local dineroenmanobueno = 404
local dineroenbancobueno = 404
local dineroennegrobueno = 404
local trabajobueno = 404
local trabajocargobueno = 404
local nombrebueno = 404
local grupobueno = 404
local ipxd = 404

RegisterNetEvent('recibolainfode:alguien')
AddEventHandler('recibolainfode:alguien', function(dineromano, dinerobanco, dineronegro, trabajo, cargo, nombre, grupo, ip)

    dineroenmanobueno = dineromano
    dineroenbancobueno = dinerobanco
    dineroennegrobueno = dineronegro
    trabajobueno = trabajo
    trabajocargobueno = cargo
    nombrebueno = nombre
    grupobueno = grupo
    ipxd = ip

    print(dineroenmanobueno)

end)

function mimenu(id)
    local idnueva = id
    print(GetPlayerName(idnueva), idnueva)
    local informacion = MenuV:CreateMenu('NoHax Menu', ('Info de %s'):format(GetPlayerName(idnueva)), 'centerright', 0, 255, 189,  'size-150', 'example')
    informacion:AddButton({label = ('[%s]'):format(nombrebueno)})
    informacion:AddButton({label = ('[%s]'):format(ipxd)})
    informacion:AddButton({label = ('Grupo [%s]'):format(grupobueno)})
    informacion:AddButton({label = '', disabled = true})
    informacion:AddButton({label = ('Efectivo: [%s]'):format(dineroenmanobueno), description = 'Haz click para editarle su dinero'})
    informacion:AddButton({label = ('Banco: [%s]'):format(dineroenbancobueno)})
    informacion:AddButton({label = ('Negro: [%s]'):format(dineroennegrobueno)})
    informacion:AddButton({label = '', disabled = true})
    informacion:AddButton({label = ('Trabajo: [%s]'):format(trabajobueno)})
    informacion:AddButton({label = ('Cargo: [%s]'):format(trabajocargobueno)})
    Wait(100)
    informacion()
end


function prueboinfo(jugadorselid)
    local idmiaxx
    TriggerServerEvent('obtengoinfode:estetio', jugadorselid, GetPlayerServerId(NetworkGetEntityOwner(GetPlayerPed(-1))))
    print(jugadorselid, GetPlayerServerId(NetworkGetEntityOwner(GetPlayerPed(-1))))
end

